inputFilePath = 'input.wav';
outputFilePath = 'output.wav';
maxBufferSize = 1000;
minBufferSize = 500;
depth = 0.5;
applyFlanger(inputFilePath, outputFilePath, maxBufferSize, minBufferSize, depth);

function applyFlanger(inputFilePath, outputFilePath, maxBufferSize, minBufferSize, depth)
    % Read input wavefile
    [inputWave, sampleRate] = audioread(inputFilePath);
    
    % Circular buffer initialization
    circularBuffer = zeros(maxBufferSize, 2);
    bufferSize = minBufferSize;
    index = uint32(1);
    
    % Output wave array initialization
    outputWave = zeros(size(inputWave));
    
    % Apply flanger effect using circular buffer
    for i = 1:length(inputWave)
        delayedSample = circularBuffer(index, :);
        outputSample = inputWave(i, :) + depth * delayedSample(1);
        outputWave(i, :) = outputSample;
        
        % Update circular buffer
        circularBuffer(index, :) = inputWave(i, :);
        index = index + 1;
        if index > bufferSize
            index = 1;
        end
        
        % Update buffer size for flanger effect
        bufferSize = minBufferSize + round((maxBufferSize - minBufferSize) * (1 + sin(2 * pi * i / 1000)) / 2);
    end
    
    % Write output wavefile
