{
	PAINTSTRUCT ps;
	switch (uMsg)
	{
	case WM_PAINT:
		BeginPaint(hWnd, &ps);
		DrawPiano(ps.hdc, MIDIKEY_FIRST, MIDIKEY_LAST);
		EndPaint(hWnd, &ps);
		break;
	case WM_KEYDOWN:
