void dtb(int n){
  int bn[32];
  int i = 0;
  while(n > 0){
    bn[i] = n % 2;
    n = n / 2;
    i++;
  }
  for (int j = i - 1; j >= 0; j--){
   p(bn[j]);
  }
}

int main(){
  int input = 0;

  p("enter a decimal number :");
  i(input);
  
  p("binary conversion: ");
  dtb(input);

  return 0;
}

